import React from 'react'
import ProductRow from './ProductTable'
import ListData from '../data/clients1.json'
class ProductTable extends React.Component { 
	render() { 

		let rows = []; 
		const data = this.props.products

		return ( 
			<table> 
			{
				data.map((item ,clientsInfo ,index)=>{
					return <ProductRow 
						list={item} 
						key = {clientsInfo} 
						dataCallback={this.hendleDataCallback}/>
				})
			}	
			</table> 
		); 
	} 
}
export default ProductTable
